&lt;p&gt;
	The establishment has been thoroughly cleaned and procedures are in place to ensure that cleanliness is maintained.&lt;br /&gt;
	&lt;br /&gt;
	A lot of reccomendations from the last inspection have been implemented.&amp;nbsp; The inspector was looking for this which could cause contamination - but the inspection was carried out when the restaurant was very busy and therefore food was still cooling before put in the fridge and there will be food debris/solied towels etc until the end of service when we throughly clean each night.&lt;/p&gt;

&lt;p&gt;
	We would like to address the recent food hygiene rating of 2 stars that we received.&lt;/p&gt;
&lt;p&gt;
	The inspection highlighted a few issues, including incorrect temperature hand wash facilities, flooring conditions, an unpainted rear ceiling, and paperwork traceability for our cheeses. We acknowledge these concerns and want to assure our customers that all issues have been rectified immediately.&lt;/p&gt;
&lt;p&gt;
	Since the inspection, we have installed the correct temperature water for hand washing, fitted new flooring in both the front and back of the shop, and painted the ceiling. Additionally, we are now keeping copies of all necessary paperwork and traceability on site to ensure compliance.&lt;/p&gt;
&lt;p&gt;
	We were misguided by information on the Food Standards Agency&amp;#39;s website, which contributed to the misunderstanding regarding the water temperature. We appreciate the guidance from the inspecting officer on the day and are committed to maintaining the highest standards of food hygiene and safety.&lt;/p&gt;
&lt;p&gt;
	&amp;nbsp;&lt;/p&gt;
&lt;p&gt;
	We are pleased to inform our customers that a reinspection is due soon, and we are confident that we will achieve full compliance. Thank you for your understanding and continued support.&lt;/p&gt;
